import React from "react";
import { Container, Row, Col } from "reactstrap";
import Newsletter from "../shared/Newsletter";

const About = () => {
  return (
    <section>
      <Container>
        <Row>
          <Col lg="12">
            <div>
              <h3>About Travel World</h3>
              <p>
                Lorem ipsum, dolor sit amet consectetur adipisicing elit.
                Officiis eligendi est magnam laboriosam quibusdam exercitationem
                vel veniam sequi nihil similique debitis aliquam ea quam neque,
                id enim suscipit odit dolore.
              </p>
            </div>
          </Col>
        </Row>
      </Container>
      <Newsletter />
    </section>
  );
};

export default About;
